import React, { Component } from 'react';
import { Col, Form, Button, Container } from 'react-bootstrap'
import axios from 'axios'
import { Formik } from 'formik';

const api = axios.create({
    baseURL: 'http://localhost:3001/api/v1/sessions'
})


function Singup() {

    /*handleSubmit = (e) => {
        const data = {
            email: this.state.email,
            password: this.state.password,
            confirmed_password: this.state.confirmed_password
        };
        api.post('/', data)
        .then(res => console.log(res))
        .catch(err => console.log(err))
        console.log(data)
        e.preventDefault();
    };*/

    return (

        <Formik
            onSubmit={console.log}
            initialValues={{
                email: '',
                password: ''
            }}
        >
            {({
                handleSubmit,
                handleChange,
                // handleBlur,
                values,
                // touched,
                // isValid,
                // errors,
            }) => (
                <Container style={{ padding: '0 10vw' }}>
                    <Form onSubmit={handleSubmit}>
                        <Form.Row>
                            <Form.Group as={Col} controlId="formGridEmail">
                                <Form.Label>Email</Form.Label>
                                <Form.Control value={ values.email } onChange={handleChange} type="email" placeholder="Enter email" />
                            </Form.Group>
                        </Form.Row>
                        <Form.Row>
                            <Form.Group as={Col} controlId="formGridPassword">
                                <Form.Label>Password</Form.Label>
                                <Form.Control value={ values.password } onChange={handleChange} type="password" placeholder="Password" />
                            </Form.Group>
                        </Form.Row>
                        {/* <Form.Row>
                            <Form.Group as={Col} controlId="formGridPassword">
                                <Form.Label>Confirm password</Form.Label>
                                <Form.Control value={ confirmed_password } onChange={this.handleChange} type="password" placeholder="Confirm password" />
                            </Form.Group>
                        </Form.Row> */}

                        <Button variant="primary" type="submit">
                            Submit
                        </Button>
                    </Form>
                </Container>
            )}
        </Formik>
    );
}


render (<Singup />);
export default Signup
